Since I'm in Australia I get to finish one day before others do. Let's go! Day 25 for me haha

Day 26, Still in.

&#x200B;

Pro tip for any artists out there who think your art sucks: Take a nap. Trust me, it will look different after you've woken up. For me, it'll look better. It may be that, from taking your mind of of your project, and all the mistakes you catch yourself making, you instead take a look from the outside. It's always helpful to take a step back and gain a new perspective on your problems, art or otherwise. It also shows that we're often doing better than we think, and just get in our own heads sometimes. Aight, see ya, I'm taking a nap.

Man, its been a busy day in air support. Stay strong, everyone!

&#x200B;

And if you're struggling, reach out. We're there to pick you up!

I feel like for most people including me, days 5-12 will be the hardest, Good luck.

&#x200B;

STILL IN!
